const Home = () => {
  return (
    <div className="hero">
      <div class="bg-dark text-white">
        <img src="/assets/bg.png" class="card-img" alt="..." height="495PX" />
        <div class=" d-flex flex-column justify-content-center">
          <div className="container">
            <h5 class="card-title display-3 fw-bolder mb-0">
              NEW SEASON ARRIVAL
            </h5>
            <p class="card-text lead fs-2">CHECK OUT ALL THE TRANDS</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
